import { useState, useEffect } from "react";
import API from "../../utils/API"

export default function useGetSetlists() {

    const [setlists, setSetlists] = useState([{}]);

    useEffect(() => {
        API.getSetlists()
            .then(setlists => setSetlists(setlists));
    }, []);

    return setlists
}
